import React from 'react';
import './index.css';
import Navbar from "./components/Navbar"

function App() {
  const [currentWeather, setCurrentWeather] = React.useState([])
  let fetchId = "de080a88d96b25b98eb394126dd6ff2f"
  let lat = "34.51"
  let lon = "-105.87"

  React.useEffect(() =>{
    fetch(`https://api.openweathermap.org/data/2.5/onecall?lat=${lat}&lon=${lon}&appid=${fetchId}`)
    .then(res => res.json())
    .then(data => setCurrentWeather(data))
  }, [])

  console.log(currentWeather.current)
  return (
    <div className="App">
      <Navbar />

    </div>
  );
}

export default App;
